import React from 'react';
import { makeStyles } from '@mui/styles';
import { Container, Typography } from '@mui/material';
// import bannerImage from './../../public/Banner.jpg'
import './../../App.css'


const useStyles = makeStyles(() => ({
    bannerContent: {
        height: 400,
        display: "flex",
      flexDirection:"column"
    },
    tagline: {
        display: "flex",
        flexDirection: "column",
        paddingTop: 25,
        justifyContent: "space-around",
        textAlign:"center",
    },
}));



const Banner = () => {
    const classes = useStyles();
    return (<div id="banner">
        <Container id="bannerContent">
            <div className={classes.tagline}>
                <Typography variant="h2" style={{ fontWeight: "bold", margin:100, fontFamily: "monospace" }}>
                    CriptoToday
                </Typography>
                <Typography variant="subtitle2" style={{fontWeight: "bold", textTransform:"capitalize", fontFamily: "monospace",color:"darkblue",fontSize:"1rem"}}>
                    The future of finance is in your hands.
                </Typography>
            </div>
        </Container>
    </div>);
}

export default Banner
